import React, { useState } from 'react'
import { myContext } from './main'
export default function Context(props) {
  const [login, setLogin] = useState(false);
  const data = {
    setLogin
  }
  return (
    <myContext.Provider value = {data}>
      {props.children}
    </myContext.Provider>
  )
}
